CREATE TABLE countries (
  id INT NOT NULL IDENTITY,
  [name] varchar(50) NOT NULL,
  slug varchar(50) NOT NULL,
  [key] varchar(10) NOT NULL,
  code varchar(10) NOT NULL,
  created_at datetime2 NOT NULL,
  updated_at datetime2 NOT NULL,
  PRIMARY KEY (id)
);
